os estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"125679","type":"Paragraph"},{"attributes":{"source":{"id":"125426"}},"id":"125430","type":"CDSView"},{"attributes":{"line_alpha":0.6,"line_color":"#3288bd","line_dash":[4,4],"line_width":1.5,"x":{"field":"x"},"y":{"field":"y"}},"id":"125455","type":"Line"},{"attributes":{"ticks":[1585440000000.0,1586044800000.0,1586649600000.0,1587254400000.0,1587859200000.0,1588464000000.0]},"id":"125677","type":"FixedTicker"},{"attributes":{"line_alpha":0.1,"line_color":"#3288bd","line_width":2,"x":{"field":"x"},"y":{"field":"y"}},"id":"125398","type":"Line"},{"attributes":{},"id":"125387","type":"HelpTool"},{"attributes":{},"id":"125385","type":"SaveTool"},{"attributes":{},"id":"125383","type":"WheelZoomTool"},{"attributes":{"overlay":{"id":"125388"}},"id":"125384","type":"BoxZoomTool"},{"attributes":{},"id":"125386","type":"ResetTool"},{"attributes":{"source":{"id":"125421"}},"id":"125425","type":"CDSView"},{"attributes":{},"id":"125382","type":"PanTool"},{"attributes":{},"id":"125379","type":"BasicTicker"},{"attributes":{"axis":{"id":"125378"},"dimension":1,"ticker":null},"id":"125381","type":"Grid"},{"attributes":{},"id":"125372","type":"LinearScale"},{"attributes":{"axis_label":"Data de Notifica\u00e7\u00e3o (Ano de 2020)","formatter":{"id":"125403"},"major_label_orientation":1.2,"ticker":{"id":"125519"}},"id":"125374","type":"DatetimeAxis"},{"attributes":{"axis":{"id":"125374"},"ticker":null},"id":"125377","type":"Grid"},{"attributes":{"text":"&lt;select id=\"16131\" onchange=\"location = this.value;\"&gt;&lt;option value=\"\"&gt;Selecione uma das Op\u00e7\u00f5es a Seguir&lt;/option&gt;&lt;option value=\"Norte.html\"&gt;Estados do Norte&lt;/option&gt;&lt;option value=\"Nordeste.html\"&gt;Estados do No
